import axios from "axios"
const SERVER = 'http://127.0.0.1:8000'
const headers = {
  'Content-Type': 'application/json',
  'Authorization': 'JWT fefege..'
}

const worldMap = () => axios.get(`${SERVER}/api/map/world-maps`)
const medPointMap = x => axios.post(`${SERVER}/api/map/med-point-map`, JSON.stringify(x),{headers})
const casesMap = x => axios.post(`${SERVER}/api/map/cases-map`, JSON.stringify(x),{headers})

export default {
  worldMap,
  medPointMap,
  casesMap,
}
